insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (110,'International Finance - Theory and Policy','International Finance Theory and Policy is built on Steve Suranovic\`s belief that to understand the international economy, students need to learn how economic models are applied to real world problems. The text provides detailed descriptions of major macroeconomic variables, covers the interest rate parity and purchasing power parity theories of exchange rate determination, takes an exhaustive look at the pros and cons of trade imbalances and presents the well-known AA-DD model to explore the effects of fiscal and monetary policy under both fixed and flexible exchange rates.',2010);
