insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (234,'Towards Efficient Exploitation of GPUs','This thesis proposes a general methodology applicable to most divide-and-conquer problems with a butterfly structure which can be formulated through the Index-Digit representation. First, we analyze the different performance factors of the GPU architecture. Next, we study several optimization techniques and design a series of modular and reusable building blocks, which will be used to create the different algorithms. Finally, we study the optimal resource balance, and through a mapping vector representation and operator algebra, we tune the algorithms for the desired configurations.',2014);
