insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (362,'Virtual Body Language','Jeffrey Ventrella, a seasoned virtual worlds programmer and visual language expert, reviews the history of avatars, smileys, and other expressive forms, and considers a future of spectacular creativity. This book combines thoughtful scholarship with amusing anecdotes from the trenches of Silicon Valley. Virtual Body Language presents a thorough analysis of the neurological, linguistic, aesthetic, and technical aspects of how nonverbal communication can be distributed over the internet. Based on nearly a decade of avatar development, Ventrella has the practical foundation on which to justify even the most outrageous claims, regarding what "avatar" might mean in the future.',2011);
