insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (363,'The Rhetoric of Video Games','As we evolve our relationship with video games, one of the most important steps we can take is to learn to play them critically, to suss out the meaning they carry, both on and under the surface. To do this requires a fluency in procedurality, the core representational form of computing. This book deals with exactly these topics.',2009);
