insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (366,'Stochastic Multiplayer Games: Theory and Algorithms','The aim of this work is to bring together algorithmic game theory with the games that are used in verifiation by extending the algorithmic theory of stochastic two-player zero-sum games to incorporate multiple players, whose objectives are not necessarily conflcting. In particular, this work contains a comprehensive study of the complexity of the most prominent solution concepts that are applicable in this setting, namely Nash and subgame-perfect equilibria.',2008);
