insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (543,'Open and Distance Education in Asia, Africa and the Middle East National Perspectives in a Digital Age','This book describes the history, structure and institutions of open and distance education in six countries: China, India, Russia, Turkey, South Africa and South Korea.  It describes how open and distance education is evolving in a digital age to reflect the needs and circumstances of the national higher education systems in these countries.  It also explores the similarities and differences between how their open and distance higher education systems are managed and structured.',2019);
