insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (555,'Research on Teaching and Learning Probability','This book summarizes the vast amount of research related to teaching and learning probability that has been conducted for more than 50 years in a variety of disciplines. This book classifies and discusses in detail the three different research periods on students’ and people’s intuitions and difficulties concerning probability: early research focused on cognitive development, a period of heuristics and biases programs, and the current period marked by a multitude of foci, approaches and theoretical frameworks.',2016);
