insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (558,'Evaluation Metrics','In an open access world, much importance has been given in using open source tools, open access resources and open solutions to engage authors and researchers in collaborative research, peer-to-peer sharing of scholarly information and collaborative evaluation of scholars’ works. Many personalized web-based services are now increasingly made available targeting global researchers’ communities, helping them to enhance their social media presence and visibility. This book discusses these topics.',2015);
