insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (562,'Supporting Individuals with Intellectual Disabilities & Mental Illness','This multidisciplinary resource develops topics of interest to all those who care about and for individuals with co-occurring intellectual disabilities and mental illness. Each chapter presents current evidence informed practice knowledge. Each topic is also presented with audio enabled text boxes emphasizing \`Key Points for Caregivers.\` For those who are interested in background knowledge, we provided the comprehensive literature base. And, for those interested mainly in \`what to do,\` we provided text box summaries for reading and listening.',2015);
