insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (563,'Resource Optimization','The concept of open access got momentum since 2000 due to growth in number of scholarly communication, particularly journals, increase in the cost of journals , shrinking budget of libraries and other problems on one hand and the need to access scholarly communications particularly the research out put of public funded research on the other. The access to scholarly communications particularly the journals has been of much concern for a long time. This book tries to explain some of the issues related to these topics.',2015);
