insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (564,'Teaching Crowds: Learning and Social Media','In Teaching Crowds, Dron and Anderson introduce a new model for understanding and exploiting the pedagogical potential of Web-based technologies, one that rests on connections — on networks and collectives — rather than on separations. Recognizing that online learning both demands and affords new models of teaching and learning, the authors show how learners can engage with social media platforms to create an unbounded field of emergent connections.',2014);
