insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (798,'The Architecture of Open Source Applications','With this first book in a series of two, the authors explain from a technical level the structure of several of the great existing open source applications. Answers to questions such as what are the main components of each program will be studied? How do they interact? And what were its builders able to learn during the experience of its development? In seeking answers to these questions, the contributors to these books provide a unique and invaluable insight into how they think.',2011);
