insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (803,'Cognitive Patterns: Problem-Solving Frameworks for Object Technology','Cognitive Patterns not only shows us how to develop cognitive-based systems, it provides a comprehensive series of best-practice models and case studies. The book supplies patterns for problem solving, teaches by example, and is based on the firsthand experience of its talented team of authors. It defines how the next generation of systems will be developed.',2011);
