insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (804,'Computer Science Design Patterns','In software engineering, a design pattern is a general reusable solution to a commonly occurring problem within a given context in software design. A design pattern is not a finished design that can be transformed directly into source or machine code. This book provides additional information on that.',2014);
