insert into digital_lib_book (digital_lib_book_id, title, description, issue_year) values (805,'GoF Design Patterns','A design pattern is a solution to a design problem. For a solution to be considered a pattern, it must have certain characteristics. One of them is that you must have proven its effectiveness by solving similar problems on previous occasions. Another is that it must be reusable, meaning that it is applicable to different design problems in different circumstances. This book helps with gaining a better understanding of that.',2008);
